  false,\n\t\"url\": null,\n\t\"notes\": \"Biological data from the Deep Ocean Mining
  Environmental Study (DOMES) wasnsubmitted by R.J. Ozretich from the University of
  Washington. The datanwere collected in the North Pacific ocean on three cruises
  of thenOCEANOGRAPER from April 26, 1978 to March 22, 1979. The cruises can benidentified
  by the following reference numbers: RP01OC78 - L01008;nRP13OC78 - L01009; and RP09OC79
  - L01010. The parameters reported arentemperature, salinity, oxygen, apparent oxygen
  utilization (AOU),nnutrients (PH, Si, NO3, NO2, NH4), ATP, chlorophyll and phaeopigmentnconcentrations.
  Original DOMES hydro data submitted on tape has beennconverted into the current
  NODC data storage format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
